text:
인생 첫 회전문을 정문성 배우님 덕에 돌게 되었네요
문드윅과 함께 웃고 울고 스트레스를 날려버리며 방방뛰기도 하고
너무나도 행복한 시간이였습니다&#128149;

마이클리 배우님의 헤드윅을 봤어요&#12316;&#12316;
처음에 영어 대사나 화면이 익숙하지 않아서 당황 스럽지만 역시 배우님의 넘버를 듣은 순간 그런 생가글 다 없어 졌어요.
다름 헤드윅와는 다른 설정도 신선했어요.
2시간이 바로 나갔어요&#12316;&#12316;

생각보다 대사가 많아서 색달랐습니다.^^;

오만석 배우님의 열정과 그 열정에 호응할줄아는 관객들로 인해

즐거웠던 공연이었습니다. ^^

2년만에 돌아온 언니는 여전히 슬프고도 아름답네요ㅠㅠ
마음 절절히 울리는 노래와 연기..
울다 웃다가 행복했어요:) 웰컴 헤드윅&#10084;
